function Movie({data}) {
  console.log(data);
  return (    
      <div key={data.id}>
        <img src={data.medium_cover_image} alt="{data.title_english}" />
        <h2>{data.title_english}</h2>
        <p>{data.summary}</p>
        <ul>
          {data.genres.map((genre, index) => 
            <li key={index}>{genre}</li>
          )}
        </ul>
      </div>
  )
}

export default Movie;
